DVD Rip.... one for the kids.

Share the thrill of a lifetime when Manny puts the pedal to the metal in the Wood Valley 500 car race! But first, can Manny, the Tools and their friend Elliot turn a broken-down jalopy into the coolest racecar ever? It will take teamwork, determination and some awesome driving skills to cross the finish line first. Tricked-out with music, excitement and surprises, Big Race! is high-octane fun for the whole family! 

